import React from "react";
import AppLayout from "./AppLayout";
import NavBar from "./NavBar";

const App = () => {
  return (
    <AppLayout>
      <NavBar />
      <h1>Welcome to Cryptoviz</h1>
    </AppLayout>
  );
};

export default App;
